// src/pages/home.js
import React from "react";
import Layout from "../components/Layout";

const Home = () => {
  return (
    <Layout>
      <div className="hero">
        <h1>Andrew Fitzpatrick</h1><h2>.rocks</h2>
      </div>
    </Layout>
  );
};

export default Home;
